import React from 'react'

import classes from './Item.module.css'

function deleteHandler  (props) {
  props.onDelete(props.id);
};


const Item=(props)=> {
  return (
    <li className={classes.item} onClick={deleteHandler} > 
     {props.children}
      {/* <h2 className={classes.item__header}>{props.title}</h2> */}
      {/* <button onClick={deleteHandler} >Delete This one</button> */}
    </li>
  )
}

export default Item;
